// ==UserScript==
// @name         DH3 Slap Chop
// @namespace    com.anwinity.dh3
// @version      1.0.7
// @description  One-Click eat-all and cook-all buttons for fish and food.
// @author       Anwinity
// @match        dh3.diamondhunt.co
// @grant        none
// @downloadURL https://update.greasyfork.org/scripts/411975/DH3%20Slap%20Chop.user.js
// @updateURL https://update.greasyfork.org/scripts/411975/DH3%20Slap%20Chop.meta.js
// ==/UserScript==

(function() {
    'use strict';

    const enabledKey = "dh3-slap-chop-enabled";

    function enable() {
        window.dh3SlapChopEnabled = true;
        localStorage.setItem(enabledKey, 1);
        $("#dh3-slap-chop-enabled").text("ENABLED");
    }

    function disable() {
        window.dh3SlapChopEnabled = false;
        localStorage.setItem(enabledKey, 0);
        $("#dh3-slap-chop-enabled").text("DISABLED");
    }

    function toggle() {
        if(window.dh3SlapChopEnabled) {
            disable();
        }
        else {
            enable();
        }
    }

    function findFood(name) {
        return Object.values(window.global_foodMap).find(food => [food.rawFoodName, food.cookedFoodName].includes(name));
    }

    // return true if handled, false otherwise
    function rightClickItem(name) {

        if(name == "fishBones") {
            let n = parseInt(window.var_fishBones||0);
            n -= n%10;
            if(n > 0) {
                sendBytes(`ADD_BONEMEAL=fishBones~${n}`);
            }
            return true;
        }

        let food = findFood(name);
        if(food) {
            let n = parseInt((window["var_"+name])||"0");
            if(n > 0) {
                if(name==food.rawFoodName) {
                    let playerHeat = parseInt(window.var_heat);
                    let heat = parseInt(food.heat);
                    let max = Math.floor(playerHeat / heat);
                    if(n > max) {
                        n = max;
                    }
                    if(n > 0) {
                        let message = `COOK=${food.rawFoodName}~${n}`;
                        sendBytes(message);
                    }
                }
                else {
                    let message = `CONSUME=${food.cookedFoodName}~${n}`;
                    sendBytes(message);
                }
            }
            return true;
        }
        return false;
    }

    function init() {
        $("#item-section-fishing-1").prepend(`
          <div class="item-box" id="dh3-slap-chop-item-box" style="background-color: rgb(0, 6, 26); border: 1px solid rgb(0, 18, 77);">
            <div style="text-align:center; font-weight: bold;font-size:12pt;color:silver;">SLAP CHOP</div>
            <div style="text-align:center">
              <img src="data:image/png;base64," class="img-100"></div>
            <div style="text-align:center" id="dh3-slap-chop-enabled"></div>
          </div>
        `);
        $("#dh3-slap-chop-item-box").click(toggle);

        let enabled = true;
        try {
            enabled = !!parseInt(localStorage.getItem(enabledKey)||"1");
        }
        catch(err) { /* localStorage value may have been corrupted, just default to enabled */ }
        if(enabled) {
            enable();
        }
        else {
            disable();
        }

        const originalRightClicksItem = window.rightClicksItem;
        window.rightClicksItem = function(name) {
            if(window.dh3SlapChopEnabled) {
                if(rightClickItem(name)) {
                    return false;
                }
                else {
                    return originalRightClicksItem.apply(this, arguments);
                }
            }
            else {
                return originalRightClicksItem.apply(this, arguments);
            }
        }
    }

    $(init);
})();